import React from 'react';
import { Player, ControlBar } from 'video-react';

function Video(){

  let video =null
  if(true) {
    video = (
      <Player
      autoPlay
      muted
      loop
      src="https://storage.googleapis.com/www.inputllc.net/kayaking.mp4"
    >
    <ControlBar disableCompletely={true}  className="my-class" />
    </Player>
    )
  } else { video = null}


  
  return (
    {video}
  );
};

export default Video;
